def Power(x,n):
	return x**n
def lam(a,b,c):
	return a**2 + b**2 + c**2 -2*a*b - 2*b*c - 2*a*c


class nu5_to_nu4_ee(vg.BatchIntegrand):

	def __init__(self, dim, MC_case):
		self.dim = dim
		self.MC_case = MC_case
	
